import React from 'react';
import Header from './Header';

function Cars(props) {
    return (
        <div>
            <section>
                <div class="text-center mb-20">
                    <h1 class="sm:text-4xl text-2xl font-bold title-font text-balablue mb-4">Cars We Fix</h1>
                    <p class="mb-8 text-lg text-secondary leading-relaxed">We service nearly all makes and models. </p>
                    <div class="flex mt-6 justify-center">
                        <div class="w-16 h-1 rounded-full bg-primary inline-flex"></div>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default Cars;
